  [],\n\t\"num_tags\": 0,\n\t\"name\": \"meteorological-and-navigational-data-collected-aboard-the-noaa-ship-rainier-in-yaquina-bay-from\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0138154 contains raw meteorological
  and navigational data logged by the Scientific Computer System (SCS) aboard NOAA
  Ship Rainier in Yaquina Bay near Newport, OR from 2014-11-21 to 2014-12-01. Office
  of Marine and Aviation Operations (OMAO) personnel aboard the ship submitted these
  data and associated metadata to NODC. In addition, NODC Accession 0138154 contains
  supplementary cruise-level metadata, which OMAO personnel logged in the Ship Daily
  Activity Log (SDAL). OMAO and NODC personnel developed the automated process to
  archive these data under the auspices of the NOAA Rolling Deck to Repository (NOAA
  R2R) program.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
